																			{
																				if ("strictTreebank3".Equals(key))
																				{
																					strictTreebank3 = val;
																				}
																				else
																				{
																					throw new ArgumentException(string.Format("%s: Invalid options key in constructor: %s%n", this.GetType().FullName, key));
																				}
																			}
																		}
																	}
																}
															}
														}
													}
												}
											}
										}
									}
								}
							}
						}
					}
				}
			}
			// this.seenUntokenizableCharacter = false; // unnecessary, it's default initialized
			if (invertible)
			{
				if (!(tf is CoreLabelTokenFactory))
				{
					throw new ArgumentException("SpanishLexer: the invertible option requires a CoreLabelTokenFactory");
				}
				prevWord = (CoreLabel)tf.MakeToken(string.Empty, 0, 0);
				prevWordAfter = new StringBuilder();
			}
		}

