		private static readonly Pattern NoBreakSpace = Pattern.Compile("\u00A0");

		private static readonly Pattern LeftParenPattern = Pattern.Compile("\\(");

		private static readonly Pattern RightParenPattern = Pattern.Compile("\\)");

		private static readonly Pattern OneFourthPattern = Pattern.Compile("\u00BC");

		private static readonly Pattern OneHalfPattern = Pattern.Compile("\u00BD");

		private static readonly Pattern ThreeFourthsPattern = Pattern.Compile("\u00BE");

		private static readonly Pattern OneThirdPattern = Pattern.Compile("\u2153");

		private static readonly Pattern TwoThirdsPattern = Pattern.Compile("\u2154");

		/* Flags begin with historical ptb3Escaping behavior */
		/*
		* This has now been extended to cover the main Windows CP1252 characters,
		* at either their correct Unicode codepoints, or in their invalid
		* positions as 8 bit chars inside the iso-8859 control region.
		*
		* ellipsis  	85  	0133  	2026  	8230
		* single quote curly starting 	91 	0145 	2018 	8216
		* single quote curly ending 	92 	0146 	2019 	8217
		* double quote curly starting 	93 	0147 	201C 	8220
		* double quote curly ending 	94 	0148 	201D 	8221
		* en dash  	96  	0150  	2013  	8211
		* em dash  	97  	0151  	2014  	8212
		*/
		/* Using Ancora style brackets and parens */
		private object NormalizeFractions(string @in)
		{
			// Strip non-breaking space
			string @out = NoBreakSpace.Matcher(@in).ReplaceAll(string.Empty);
			if (normalizeFractions)
			{
				if (escapeForwardSlashAsterisk)
				{
					@out = OneFourthPattern.Matcher(@out).ReplaceAll("1\\\\/4");
					@out = OneHalfPattern.Matcher(@out).ReplaceAll("1\\\\/2");
					@out = ThreeFourthsPattern.Matcher(@out).ReplaceAll("3\\\\/4");
					@out = OneThirdPattern.Matcher(@out).ReplaceAll("1\\\\/3");
					@out = TwoThirdsPattern.Matcher(@out).ReplaceAll("2\\\\/3");
				}
				else
				{
					@out = OneFourthPattern.Matcher(@out).ReplaceAll("1/4");
					@out = OneHalfPattern.Matcher(@out).ReplaceAll("1/2");
					@out = ThreeFourthsPattern.Matcher(@out).ReplaceAll("3/4");
					@out = OneThirdPattern.Matcher(@out).ReplaceAll("1/3");
					@out = TwoThirdsPattern.Matcher(@out).ReplaceAll("2/3");
				}
			}
			return GetNext(@out, @in);
		}

		private static readonly Pattern asciiSingleQuote = Pattern.Compile("&apos;|[\u0082\u0091\u2018\u0092\u2019\u201A\u201B\u2039\u203A']");

		private static readonly Pattern asciiDoubleQuote = Pattern.Compile("&quot;|[\u0084\u0093\u201C\u0094\u201D\u201E\u00AB\u00BB\"]");

		private static string Shlomi2AsciiQuotes(string @in)
		{
			return AsciiQuotes(@in);
		}

		private static string Shlomi3AsciiQuotes(string @in)
		{
			return AsciiQuotes(@in);
		}

		private static string AsciiQuotes(string @in)
		{
			string s1 = @in;
			s1 = asciiSingleQuote.Matcher(s1).ReplaceAll("'");
			s1 = asciiDoubleQuote.Matcher(s1).ReplaceAll("\"");
			return s1;
		}

		private static string NonCp1252Quotes(string @in)
		{
			switch (@in)
			{
				case "\u008B":
				{
					return "\u2039";
				}

				case "\u0091":
				{
					return "\u2018";
				}

				case "\u0092":
				{
					return "\u2019";
				}

				case "\u0093":
				{
					return "\u201C";
				}

				case "\u0094":
				{
					return "\u201D";
				}

				case "\u009B":
				{
					return "\u203A";
				}

				default:
				{
					return @in;
				}
			}
		}

		private string HandleQuotes(string @in)
		{
			if (asciiQuotes)
			{
				return AsciiQuotes(@in);
			}
			else
			{
				return NonCp1252Quotes(@in);
			}
		}

		private static readonly Pattern dashes = Pattern.Compile("[_\u058A\u2010\u2011]");

		private static string AsciiDash(string @in)
		{
			return dashes.Matcher(@in).ReplaceAll("-");
		}

		private string HandleDash(string @in)
		{
			if (asciiDash)
			{
				return AsciiDash(@in);
			}
			else
			{
				return @in;
			}
		}

		private object HandleEllipsis(string tok)
		{
			if (ptb3Ellipsis)
			{
				return GetNext(ptb3EllipsisStr, tok);
			}
			else
			{
				if (unicodeEllipsis)
				{
					return GetNext(unicodeEllipsisStr, tok);
				}
				else
				{
					return GetNext(tok, tok);
				}
			}
		}

		/// <summary>
		/// This quotes a character with a backslash, but doesn't do it
		/// if the character is already preceded by a backslash.
		/// </summary>
		private static string Delimit(string s, char c)
		{
			int i = s.IndexOf(c);
			while (i != -1)
			{
				if (i == 0 || s[i - 1] != '\\')
				{
					s = Sharpen.Runtime.Substring(s, 0, i) + '\\' + Sharpen.Runtime.Substring(s, i);
					i = s.IndexOf(c, i + 2);
				}
				else
				{
					i = s.IndexOf(c, i + 1);
				}
			}
			return s;
		}

		private static string ConvertToEl(string l)
		{
			if (char.IsLowerCase(l[0]))
			{
				return "e" + l;
			}
			else
			{
				return "E" + l;
			}
		}

		private object GetNext()
		{
			string txt = Yytext();
			return GetNext(txt, txt);
		}

		/// <summary>Make the next token.</summary>
		/// <param name="txt">What the token should be</param>
		/// <param name="originalText">The original String that got transformed into txt</param>
		private object GetNext(string txt, string originalText)
		{
			return GetNext(txt, originalText, null);
		}

		private object GetNext(string txt, string originalText, string annotation)
		{
			txt = LexerUtils.RemoveSoftHyphens(txt);
			ILabel w = (ILabel)tokenFactory.MakeToken(txt, yychar, Yylength());
			if (invertible || annotation != null)
			{
				CoreLabel word = (CoreLabel)w;
				if (invertible)
				{
					string str = prevWordAfter.ToString();
					prevWordAfter.Length = 0;
					word.Set(typeof(CoreAnnotations.OriginalTextAnnotation), originalText);
					word.Set(typeof(CoreAnnotations.BeforeAnnotation), str);
					prevWord.Set(typeof(CoreAnnotations.AfterAnnotation), str);
					prevWord = word;
				}
				if (annotation != null)
				{
					word.Set(typeof(CoreAnnotations.ParentAnnotation), annotation);
				}
			}
			return w;
		}

		private object GetNormalizedAmpNext()
		{
			string txt = Yytext();
			return normalizeAmpersandEntity ? GetNext(LexerUtils.NormalizeAmp(txt), txt) : GetNext();
		}

		/// <summary>Creates a new scanner</summary>
		/// <param name="in">the java.io.Reader to read input from.</param>
		internal SpanishLexer(Reader @in)
		{
			this.zzReader = @in;
		}

		/// <summary>Unpacks the compressed character translation table.</summary>
		/// <param name="packed">the packed character translation table</param>
		/// <returns>the unpacked character translation table</returns>
		private static char[] ZzUnpackCMap(string packed)
		{
			char[] map = new char[unchecked((int)(0x110000))];
			int i = 0;
			/* index in packed string  */
			int j = 0;
			/* index in unpacked array */
			while (i < 3366)
			{
				int count = packed[i++];
				char value = packed[i++];
				do
				{
					map[j++] = value;
				}
				while (--count > 0);
			}
			return map;
		}

		/// <summary>Refills the input buffer.</summary>
		/// <returns><code>false</code>, iff there was new input.</returns>
		/// <exception>
		/// java.io.IOException
		/// if any I/O-Error occurs
		/// </exception>
		/// <exception cref="System.IO.IOException"/>
		private bool ZzRefill()
		{
			/* first: make room (if you can) */
			if (zzStartRead > 0)
			{
				zzEndRead += zzFinalHighSurrogate;
				zzFinalHighSurrogate = 0;
				System.Array.Copy(zzBuffer, zzStartRead, zzBuffer, 0, zzEndRead - zzStartRead);
				/* translate stored positions */
				zzEndRead -= zzStartRead;
				zzCurrentPos -= zzStartRead;
				zzMarkedPos -= zzStartRead;
				zzStartRead = 0;
			}
			/* is the buffer big enough? */
			if (zzCurrentPos >= zzBuffer.Length - zzFinalHighSurrogate)
			{
				/* if not: blow it up */
				char[] newBuffer = new char[zzBuffer.Length * 2];
				System.Array.Copy(zzBuffer, 0, newBuffer, 0, zzBuffer.Length);
				zzBuffer = newBuffer;
				zzEndRead += zzFinalHighSurrogate;
				zzFinalHighSurrogate = 0;
			}
			/* fill the buffer with new input */
			int requested = zzBuffer.Length - zzEndRead;
			int numRead = zzReader.Read(zzBuffer, zzEndRead, requested);
			/* not supposed to occur according to specification of java.io.Reader */
			if (numRead == 0)
			{
				throw new IOException("Reader returned 0 characters. See JFlex examples for workaround.");
			}
			if (numRead > 0)
			{
				zzEndRead += numRead;
				/* If numRead == requested, we might have requested to few chars to
				encode a full Unicode character. We assume that a Reader would
				otherwise never return half characters. */
				if (numRead == requested)
				{
					if (char.IsHighSurrogate(zzBuffer[zzEndRead - 1]))
					{
						--zzEndRead;
						zzFinalHighSurrogate = 1;
					}
				}
				/* potentially more input available */
				return false;
			}
			/* numRead < 0 ==> end of stream */
			return true;
		}

		/// <summary>Closes the input stream.</summary>
		/// <exception cref="System.IO.IOException"/>
		public void Yyclose()
		{
			zzAtEOF = true;
			/* indicate end of file */
			zzEndRead = zzStartRead;
			/* invalidate buffer    */
			if (zzReader != null)
			{
				zzReader.Close();
			}
		}

		/// <summary>Resets the scanner to read from a new input stream.</summary>
		/// <remarks>
		/// Resets the scanner to read from a new input stream.
		/// Does not close the old reader.
		/// All internal variables are reset, the old input stream
		/// <b>cannot</b> be reused (internal buffer is discarded and lost).
		/// Lexical state is set to <tt>ZZ_INITIAL</tt>.
		/// Internal scan buffer is resized down to its initial length, if it has grown.
		/// </remarks>
		/// <param name="reader">the new input stream</param>
		public void Yyreset(Reader reader)
		{
			zzReader = reader;
			zzAtBOL = true;
			zzAtEOF = false;
			zzEOFDone = false;
			zzEndRead = zzStartRead = 0;
			zzCurrentPos = zzMarkedPos = 0;
			zzFinalHighSurrogate = 0;
			yyline = yychar = yycolumn = 0;
			zzLexicalState = Yyinitial;
			if (zzBuffer.Length > ZzBuffersize)
			{
				zzBuffer = new char[ZzBuffersize];
			}
		}

		/// <summary>Returns the current lexical state.</summary>
		public int Yystate()
		{
			return zzLexicalState;
		}

		/// <summary>Enters a new lexical state</summary>
		/// <param name="newState">the new lexical state</param>
		public void Yybegin(int newState)
		{
			zzLexicalState = newState;
		}

		/// <summary>Returns the text matched by the current regular expression.</summary>
		public string Yytext()
		{
			return new string(zzBuffer, zzStartRead, zzMarkedPos - zzStartRead);
		}

		/// <summary>
		/// Returns the character at position <tt>pos</tt> from the
		/// matched text.
		/// </summary>
		/// <remarks>
		/// Returns the character at position <tt>pos</tt> from the
		/// matched text.
		/// It is equivalent to yytext().charAt(pos), but faster
		/// </remarks>
		/// <param name="pos">
		/// the position of the character to fetch.
		/// A value from 0 to yylength()-1.
		/// </param>
		/// <returns>the character at position pos</returns>
		public char Yycharat(int pos)
		{
			return zzBuffer[zzStartRead + pos];
		}

		/// <summary>Returns the length of the matched text region.</summary>
		public int Yylength()
		{
			return zzMarkedPos - zzStartRead;
		}

		/// <summary>Reports an error that occured while scanning.</summary>
		/// <remarks>
		/// Reports an error that occured while scanning.
		/// In a wellformed scanner (no or only correct usage of
		/// yypushback(int) and a match-all fallback rule) this method
		/// will only be called with things that "Can't Possibly Happen".
		/// If this method is called, something is seriously wrong
		/// (e.g. a JFlex bug producing a faulty scanner etc.).
		/// Usual syntax/scanner level error handling should be done
		/// in error fallback rules.
		/// </remarks>
		/// <param name="errorCode">the code of the errormessage to display</param>
		private void ZzScanError(int errorCode)
		{
			string message;
			try
			{
				message = ZzErrorMsg[errorCode];
			}
			catch (IndexOutOfRangeException)
			{
				message = ZzErrorMsg[ZzUnknownError];
			}
			throw new Exception(message);
		}

		/// <summary>Pushes the specified amount of characters back into the input stream.</summary>
		/// <remarks>
		/// Pushes the specified amount of characters back into the input stream.
		/// They will be read again by then next call of the scanning method
		/// </remarks>
		/// <param name="number">
		/// the number of characters to be read again.
		/// This number must not be greater than yylength()!
		/// </param>
		public virtual void Yypushback(int number)
		{
			if (number > Yylength())
			{
				ZzScanError(ZzPushback2big);
			}
			zzMarkedPos -= number;
		}

		/// <summary>
		/// Resumes scanning until the next regular expression is matched,
		/// the end of input is encountered or an I/O-Error occurs.
		/// </summary>
		/// <returns>the next token</returns>
		/// <exception>
		/// java.io.IOException
		/// if any I/O-Error occurs
		/// </exception>
		/// <exception cref="System.IO.IOException"/>
		public virtual object Next()
		{
			int zzInput;
			int zzAction;
			// cached fields:
			int zzCurrentPosL;
			int zzMarkedPosL;
			int zzEndReadL = zzEndRead;
			char[] zzBufferL = zzBuffer;
			char[] zzCMapL = ZzCmap;
			int[] zzTransL = ZzTrans;
			int[] zzRowMapL = ZzRowmap;
			int[] zzAttrL = ZzAttribute;
			while (true)
			{
				zzMarkedPosL = zzMarkedPos;
				yychar += zzMarkedPosL - zzStartRead;
				zzAction = -1;
				zzCurrentPosL = zzCurrentPos = zzStartRead = zzMarkedPosL;
				zzState = ZzLexstate[zzLexicalState];
				// set up zzAction for empty match case:
				int zzAttributes = zzAttrL[zzState];
				if ((zzAttributes & 1) == 1)
				{
					zzAction = zzState;
				}
				while (true)
				{
					if (zzCurrentPosL < zzEndReadL)
					{
						zzInput = char.CodePointAt(zzBufferL, zzCurrentPosL, zzEndReadL);
						zzCurrentPosL += char.CharCount(zzInput);
					}
					else
					{
						if (zzAtEOF)
						{
							zzInput = Yyeof;
							goto zzForAction_break;
						}
						else
						{
							// store back cached positions
							zzCurrentPos = zzCurrentPosL;
							zzMarkedPos = zzMarkedPosL;
							bool eof = ZzRefill();
							// get translated positions and possibly new buffer
							zzCurrentPosL = zzCurrentPos;
							zzMarkedPosL = zzMarkedPos;
							zzBufferL = zzBuffer;
							zzEndReadL = zzEndRead;
							if (eof)
							{
								zzInput = Yyeof;
								goto zzForAction_break;
							}
							else
							{
								zzInput = char.CodePointAt(zzBufferL, zzCurrentPosL, zzEndReadL);
								zzCurrentPosL += char.CharCount(zzInput);
							}
						}
					}
					int zzNext = zzTransL[zzRowMapL[zzState] + zzCMapL[zzInput]];
					if (zzNext == -1)
					{
						goto zzForAction_break;
					}
					zzState = zzNext;
					zzAttributes = zzAttrL[zzState];
					if ((zzAttributes & 1) == 1)
					{
						zzAction = zzState;
						zzMarkedPosL = zzCurrentPosL;
						if ((zzAttributes & 8) == 8)
						{
							goto zzForAction_break;
						}
					}
				}
zzForAction_break: ;
				// store back cached position
				zzMarkedPos = zzMarkedPosL;
				if (zzInput == Yyeof && zzStartRead == zzCurrentPos)
				{
					zzAtEOF = true;
					{
						if (invertible)
						{
							prevWordAfter.Append(Yytext());
							string str = prevWordAfter.ToString();
							prevWordAfter.Length = 0;
							prevWord.Set(typeof(CoreAnnotations.AfterAnnotation), str);
						}
						return null;
					}
				}
				else
				{
					switch (zzAction < 0 ? zzAction : ZzAction[zzAction])
					{
						case 1:
						{
							string str = Yytext();
							int first = str[0];
							string msg = string.Format("Untokenizable: %s (U+%s, decimal: %s)", Yytext(), int.ToHexString(first).ToUpper(), int.ToString(first));
							switch (untokenizable)
							{
								case SpanishLexer.UntokenizableOptions.NoneDelete:
								{
									if (invertible)
									{
										prevWordAfter.Append(str);
									}
									break;
								}

								case SpanishLexer.UntokenizableOptions.FirstDelete:
								{
									if (invertible)
									{
										prevWordAfter.Append(str);
									}
									if (!this.seenUntokenizableCharacter)
									{
										Logger.Warning(msg);
										this.seenUntokenizableCharacter = true;
									}
									break;
								}

								case SpanishLexer.UntokenizableOptions.AllDelete:
								{
									if (invertible)
									{
										prevWordAfter.Append(str);
									}
									Logger.Warning(msg);
									this.seenUntokenizableCharacter = true;
									break;
								}

								case SpanishLexer.UntokenizableOptions.NoneKeep:
								{
									return GetNext();
								}

								case SpanishLexer.UntokenizableOptions.FirstKeep:
								{
									if (!this.seenUntokenizableCharacter)
									{
										Logger.Warning(msg);
										this.seenUntokenizableCharacter = true;
									}
									return GetNext();
								}

								case SpanishLexer.UntokenizableOptions.AllKeep:
								{
									Logger.Warning(msg);
									this.seenUntokenizableCharacter = true;
									return GetNext();
								}
							}
							goto case 39;
						}

						case 39:
						{
							break;
						}

						case 2:
						{
							return GetNext("<", Yytext());
						}

						case 40:
						{
							break;
						}

						case 3:
						{
							if (escapeForwardSlashAsterisk)
							{
								return GetNext(Delimit(Yytext(), '/'), Yytext());
							}
							else
							{
								return GetNext();
							}
							goto case 41;
						}

						case 41:
						{
							break;
						}

						case 4:
						{
							return GetNext();
						}

						case 42:
						{
							break;
						}

						case 5:
						{
							if (tokenizeNLs)
							{
								return GetNext(NewlineToken, Yytext());
							}
							else
							{
								// js: for tokenizing carriage returns
								if (invertible)
								{
									prevWordAfter.Append(Yytext());
								}
							}
							goto case 43;
						}

						case 43:
						{
							break;
						}

						case 6:
						{
							return GetNext(">", Yytext());
						}

						case 44:
						{
							break;
						}

						case 7:
						{
							if (ptb3Dashes)
							{
								return GetNext(ptbmdash, Yytext());
							}
